        <div className="card-content">
          <p className="card-title"> Card Title </p>
          <p className="card-desc"> What is Lorem Ipsum Lorem Ipsum is </p>
          <button>Click Here</button>
        </div>
      </div>
    </>
  );
}

export default Card;
